import { Dialog, Box, TextField, typography, Button } from '@mui/material';

const LoginDialog = ({open, setOpen}) => {
    const handelClose = () => {
        setOpen(false); 
    }
    return (
            
            <Dialog open = {open} onClose={handelClose}>
                <Box>
                    <Box></Box>
                    <Box>
                        <TextField vareint="standard" label="Enter Email/Mobile number"/>
                        <TextField vareint="standard" label="Enter Password"/>
                        <TextField>By continuing, you agree to flipkart's Terms of use and Privacy Policy.</TextField>
                    </Box>
                </Box>
            </Dialog>
    )
}

export default LoginDialog;
